История идеи началась с желания достичь социального равенства общества, уравновешивания разницы между богатыми и средними, чтобы все блага были доступны для всех. Это стало возможным благодаря развитию промышленности и появлению более дешевых материалов и способов обработки. Можно выделить два направления: классический (в серо-черно-белых тонах с яркими акцентами) и перенятый западом вариант в пудровых оттенках. Однако оба придерживаются определенных правил:
стены всегда светлые, полы деревянные, материалы натуральные (хлопок, лен); 
цвет тяготит к природным сочетаниям;
текстиль лаконичен по текстуре, но с геометрическим рисунком (шторы, ковры, подушки);
освещения всегда много;
мебель простая и функциональная.
